import React from "react";

class Reservation extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: new Date()

        };
    }
    render(){
        return(
            <table class="table table-success table-striped-columns">
                 <thead>
                        <tr>
                        <th scope="col">반려동물 이름</th>
                        <th scope="col">달구</th>
                        <th scope="col">이름</th>
                        <th scope="col">김미소</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <th scope="row">반려동물 종류</th>
                        <td>믹스견(장모종)</td>
                        <td>전화번호</td>
                        <td>010-xxxx-xxxx</td>
                        </tr>
                        <tr>
                        <th scope="row">반려동물 성별</th>
                        <td>여(중성화)</td>
                        <td>주소</td>
                        <td>부산광역시 동래구 000</td>
                        </tr>
                        <tr>
                        <th scope="row">요청사항</th>
                        <td colspan="3">Larry the Bird</td>
                        </tr>
                    </tbody>
            </table>
        )
    }
        
}
export default Reservation;
